Colombian actress and model
Sandra Vergara (born September 11, 1988) is a Colombian actress and model. She is the cousin and adopted sister of actress Sofia Vergara.
She appeared in a 2009 episode of CSI: Miami entitled &quot;Head Case&quot;. She appeared in the film Fright Night as Ginger, her first feature film. In March 2011, Vergara was cast in the pilot of NBC's Mann's World.

